Mirai.NET用MiraiBot类来表述一个 Mirai 机器人对象，可以有多个MiraiBot类实例， 但是一经启动之后，Mirai.NET只会调用最后一个启动的MiraiBot实例。 Mirai.NET实现了IDisposable接口，所以你应该在用不到此对象的时候调用其Dispose方法来释放资源，或者直接在初始化的时候使用using关键字。 using var bot = new MiraiBot
{ Address = "localhost:8080", QQ = xxx, VerifyKey = "xxx"
}; 创建一个MiraiBot对象只需要三个属性: QQ，就是mirai console登陆的机器人的账号 VerifyKey，就是mirai-api-http配置文件内的verifyKey Address，就是mirai-api-http配置文件内的adapterSettings的host:port组合值。 Mirai.NET 需要http和ws这两个 adapter 的 host 和 post 相同。 创建完MiraiBot对象，就可以调用Launch方法来启动了: await bot.LaunchAsync(); 注意，调用LaunchAsync方法并不会阻塞线程，所以如果你不想要你的程序马上退出的话，你应该自己阻塞线程。 使用死循环: while (true)
{ if (Console.ReadLine() == "exit") { return; }
} 使用信号: var signal = new ManualResetEvent(false);
signal.WaitOne();

