所谓消息链，在Mirai.Net以一个类型MessageChain来表示，此类型继承自List<MessageBase>，所以你只需要像使用List一样使用它。 构造一个最基础的消息链： var messageChain = new MessageChain
{ new AtMessage("114514"), new PlainMessage("Hello World!"),
}; 这就是一个基础的消息链，它表示包含一个At消息和一个文本消息，但是你会发现，这么构造消息链显然太麻烦了，所以Mirai.Net提供了一个更简单的构造方式： var messageChain = new MessageChainBuilder() .At("114514") .Plain("Hello World!") .Build(); 值得注意的是，下面的代码是合法的。因为在MessageChain内部实现了从MessageBase到MessageChain的隐式转换，也就是以目前MessageBase对象创建一个单元素的MessageChain。（但是MessageChain不可以转换为MessageBase） MessageChain messageChain = new PlainMessage("Hello World!");

