{ internal static class Program { private static async Task Main() { var exit = new ManualResetEvent(false); using var bot = new MiraiBot { Address = "localhost:8080", VerifyKey = "1145141919810", QQ = "1590454991" }; await bot.LaunchAsync(); bot.MessageReceived .OfType<GroupMessageReceiver>() .Subscribe(async r => { if (r.MessageChain.GetPlainMessage() == "/send") { await r.SendMessageAsync("the true message will be revealed in 5 seconds"); DispatchUtils.ExecuteScheduledActionAsync(5000, async () => { await r.SendMessageAsync("this message will be recalled after 5 seconds") .RecallAfter(5000); }); } }); Console.WriteLine("launched"); exit.WaitOne(); } }
}
